import React from 'react';

function UserInfo({ userInfo }) {
  // Format age_grouped
  const formatAgeGroup = (ageGrouped) => {
    const ageGroupMap = {
      '<25': 'Under 25',
      '25-35': '25 to 34',
      '35-45': '35 to 44',
      '45+': '45 and Over',
    };
    return ageGroupMap[ageGrouped] || ageGrouped || 'N/A';
  };

  // Format income_grouped
  const formatIncomeGroup = (incomeGrouped) => {
    const incomeGroupMap = {
      'Unknown': 'Unknown',
      '<50k': 'Under $50,000',
      '50k-100k': '$50,000 - $99,999',
      '100k+': '$100,000 and Over',
    };
    return incomeGroupMap[incomeGrouped] || incomeGrouped || 'N/A';
  };

  // Format sex
  const formatSex = (sex) => {
    return sex === 'M' ? 'Male' : sex === 'F' ? 'Female' : sex || 'N/A';
  };

  // Format boolean/binary fields
  const formatBinary = (value) => {
    return value === 1 || value === '1' || value === true ? 'Yes' : value === 0 || value === '0' || value === false ? 'No' : value || 'N/A';
  };

  // Format currency
  const formatCurrency = (value) => {
    return value ? `$${Number(value).toLocaleString()}` : 'N/A';
  };

  // Format date
  const formatDate = (value) => {
    return value ? new Date(value).toLocaleDateString() : 'N/A';
  };

  // Danh sách trường và nhãn hiển thị
  const fields = [
    { key: 'username', label: 'Username' },
    { key: 'email', label: 'Email' },
    { key: 'age', label: 'Age' },
    { key: 'sex', label: 'Sex', format: formatSex },
    { key: 'income', label: 'Income', format: formatCurrency },
    { key: 'segment', label: 'Segment' },
    { key: 'age_grouped', label: 'Age Group', format: formatAgeGroup },
    { key: 'income_grouped', label: 'Income Group', format: formatIncomeGroup },
    { key: 'fecha_dato', label: 'Data Date', format: formatDate },
    { key: 'ind_empleado', label: 'Employee Indicator' },
    { key: 'pais_residencia', label: 'Country of Residence' },
    { key: 'fecha_alta', label: 'Registration Date', format: formatDate },
    { key: 'ind_nuevo', label: 'New Customer', format: formatBinary },
    { key: 'antiguedad', label: 'Customer Seniority (Months)' },
    { key: 'indrel', label: 'Customer Relationship Type' },
    { key: 'ult_fec_cli_1t', label: 'Last Primary Customer Date', format: formatDate },
    { key: 'indrel_1mes', label: 'Customer Type (Month Start)' },
    { key: 'tiprel_1mes', label: 'Customer Relation Type (Month Start)' },
    { key: 'indresi', label: 'Resident Indicator', format: formatBinary },
    { key: 'indext', label: 'Foreigner Indicator', format: formatBinary },
    { key: 'conyuemp', label: 'Spouse Employee Indicator' },
    { key: 'canal_entrada', label: 'Channel of Entry' },
    { key: 'indfall', label: 'Deceased Indicator', format: formatBinary },
    { key: 'tipodom', label: 'Address Type' },
    { key: 'cod_prov', label: 'Province Code' },
    { key: 'nomprov', label: 'Province Name' },
    { key: 'ind_actividad_cliente', label: 'Customer Activity', format: formatBinary },
    { key: 'renta', label: 'Gross Household Income', format: formatCurrency },
    { key: 'ind_ahor_fin_ult1', label: 'Savings Account', format: formatBinary },
    { key: 'ind_aval_fin_ult1', label: 'Guarantees', format: formatBinary },
    { key: 'ind_cco_fin_ult1', label: 'Current Account', format: formatBinary },
    { key: 'ind_cder_fin_ult1', label: 'Derivative Account', format: formatBinary },
    { key: 'ind_cno_fin_ult1', label: 'Payroll Account', format: formatBinary },
    { key: 'ind_ctju_fin_ult1', label: 'Junior Account', format: formatBinary },
    { key: 'ind_ctma_fin_ult1', label: 'Más Particular Account', format: formatBinary },
    { key: 'ind_ctop_fin_ult1', label: 'Particular Account', format: formatBinary },
    { key: 'ind_ctpp_fin_ult1', label: 'Particular Plus Account', format: formatBinary },
    { key: 'ind_deco_fin_ult1', label: 'Short-Term Deposits', format: formatBinary },
    { key: 'ind_deme_fin_ult1', label: 'Medium-Term Deposits', format: formatBinary },
    { key: 'ind_dela_fin_ult1', label: 'Long-Term Deposits', format: formatBinary },
    { key: 'ind_ecue_fin_ult1', label: 'e-Account', format: formatBinary },
    { key: 'ind_fond_fin_ult1', label: 'Funds', format: formatBinary },
    { key: 'ind_hip_fin_ult1', label: 'Mortgage', format: formatBinary },
    { key: 'ind_plan_fin_ult1', label: 'Pension Plan', format: formatBinary },
    { key: 'ind_pres_fin_ult1', label: 'Loans', format: formatBinary },
    { key: 'ind_reca_fin_ult1', label: 'Taxes', format: formatBinary },
    { key: 'ind_tjcr_fin_ult1', label: 'Credit Card', format: formatBinary },
    { key: 'ind_valo_fin_ult1', label: 'Securities', format: formatBinary },
    { key: 'ind_viv_fin_ult1', label: 'Home Account', format: formatBinary },
    { key: 'ind_nomina_ult1', label: 'Payroll', format: formatBinary },
    { key: 'ind_nom_pens_ult1', label: 'Pensions', format: formatBinary },
    { key: 'ind_recibo_ult1', label: 'Direct Debit', format: formatBinary },
    { key: 'last_login', label: 'Last Login', format: formatDate },
    { key: 'created_at', label: 'Account Created', format: formatDate },
  ];

  return (
    <div className="bg-white p-8 rounded-lg shadow-lg">
      <h2 className="text-2xl font-bold mb-6 text-blue-600">User Information</h2>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
        {fields.map(({ key, label, format }) => (
          <div key={key} className="mb-2">
            <strong className="text-gray-700">{label}:</strong>{' '}
            <span className="text-gray-600">
              {format ? format(userInfo[key]) : userInfo[key] || 'N/A'}
            </span>
          </div>
        ))}
      </div>
    </div>
  );
}

export default UserInfo;
